// SPDX-License-Identifier: MIT
pragma solidity ^0.8.9;

import "./../Pool/Extra/PoolBaseStruct.sol";
import "./../Pool/Extra/PoolVirtual.sol";

import "@openzeppelin/contracts/utils/Counters.sol";

// Diversi tipi di box
contract Box is PoolBaseStruct, PoolBoxVirtual {
    
    using Counters for Counters.Counter;
    Counters.Counter private _tokenIdCounter;

    address private MintingAddress;

    mapping(uint256 => BoxInfo) public BoxList;
    mapping(uint256 => uint256[]) public BoxRarity;




    constructor (
        address _NFTManagerAddress,
        address _RandomChoiceAddress,
        address _MintingAddress,

        string memory _baseUri
    ) 
        
        PoolBaseStruct (
            _NFTManagerAddress, _RandomChoiceAddress,
            _baseUri, "BOX", "BX"
        ) 

    { MintingAddress = _MintingAddress; }



    /**
        This function permit to create a new box from 2 params:
            1. objKey   This param set the type of obj into the box: 
                                0 == avatar
                                1 == stone
                                2 == wearable
            2. r1:      This param set the rarity of box
     */
    function createANewBox(
        uint256 objKey,
        uint256 r1
    ) public override returns(uint256 tokenId) {
        require(msg.sender == MintingAddress || msg.sender == owner(), "Sender is not right");

        uint256 getTokenRarity = RandomChoice(getRandomChoiceAddress()).choiceInArray(BoxRarity[r1]);

        tokenId = _tokenIdCounter.current();
        _tokenIdCounter.increment();
        BoxList[tokenId].tokenRarity = getTokenRarity;
        BoxList[tokenId].objKey = objKey;
        BoxList[tokenId].boxInfoCheck = true;

        _safeMint(msg.sender, tokenId);
        _setTokenURI(tokenId, string.concat("Box ", Strings.toString(tokenId)));

    }



    function openBox(uint256 boxKey) public override {
        require(IERC721(address(this)).ownerOf(boxKey) == msg.sender, "You do not own this NFT");
        
        BoxInfo memory bi = BoxList[boxKey];
        // This line of code check thath this box is not already open
        require(bi.boxInfoCheck, "The NFT is already open");
        BoxList[boxKey].boxInfoCheck = false;

        _burn(boxKey);
        NFTManager(getNFTManagerAddress()).NFTSafeMint(msg.sender, bi.tokenRarity, bi.objKey);
    }

}
